import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import Box from '@mui/material/Box';
import React  from 'react';
import '../App.css';

const Write: React.FC = () => {
    return (
    <div className='writeform'>
        <Box sx={{display: 'flex',position:'relative', width:700, height:700, margin:'auto', textAlign:'center', border: 1, borderRadius: 5, backgroundColor:'#ffffff', flexDirection: 'column', mt:5, pl:3,pr:3}}>
            <TextField id="company-name" label="기업명" variant="outlined" size="small" margin="normal"/>
            <TextField id="company-url" label="홈페이지주소" variant="outlined" size="small" margin="normal"/>
            <TextField id="company-impomation" label="기업정보" variant="outlined" size="small" margin="normal"/>
            <TextField id="company-ceo" label="대표" variant="outlined" size="small" margin="normal"/>
            <TextField id="company-adress" label="주소" variant="outlined" size="small" margin="normal"/>
            <TextField id="company-content" label="기업내용" variant="outlined" size="small" margin="normal" sx ={{height:400}}/>
            <input type="file" id="fileUpload" />
            <br/>
            <Button variant="outlined" sx={{ color:'#ffff', backgroundColor: '#5856D6', borderColor:'#434343'}}>
                    작성
            </Button>
        </Box>
    </div>

);
}
export default Write;
